<p><code>USER</code>指令和<code>WORKDIR</code>相似，都是改变环境状态并影响以后的层。<code>WORKDIR</code>是改变工作目录，<code>USER</code>则是改变之后层的执行<code>RUN</code>，<code>CMD</code>和<code>ENTRYPOINT</code>这类命令的身份。</p>
